void changeReg4Bit( int bit_index, int new_val)
{
	  unsigned long val;
	  unsigned long mask = 1 << (bit_index);  //shift left to get to index
	  val = ASCON_AXI_mReadReg(0x44a00000,ASCON_AXI_S00_AXI_SLV_REG4_OFFSET);
	  if (new_val)
	    val |= mask;  // set bit
	  else
	   val &= ~mask;  // clear bit
	  ASCON_AXI_mWriteReg(0x44a00000,ASCON_AXI_S00_AXI_SLV_REG4_OFFSET, val);
}
int ReadReg4Bit( int bit_index)
{
	  unsigned long val;
	  unsigned long mask = 1 << (bit_index);
	  val = ASCON_AXI_mReadReg(0x44a00000,ASCON_AXI_S00_AXI_SLV_REG4_OFFSET);

	  val &= mask;
	  if (val > 0)
		  return true; //val > 0 means bit is 1
	  else
		  return false;
}
